  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Valentine
  National Wildlife Refuge outlines Refuge accomplishments during the 1990 calendar
  year.  The report begins with a summary of the year's highlights and weather conditions.
  The report includes a planning section which discusses compliance with environmental
  and cultural resource mandates and research and investigations. Refuge administration
  is outlined; information about personnel, youth programs, volunteer programs, funding,
  safety, and technical assistance is given. Habitat management is also covered; subjects
  include wetlands, grasslands, grazing, haying, water rights, and WPA easements.
  The wildlife section of the report discusses wildlife diversity, endangered and
  threatened species, waterfowl, marsh birds and waterbirds, shorebirds, raptors,
  game mammals, fisheries resources, scientific collections, animal control, marking
  and banding, and disease control. The public uses of the Refuge described in this
  report include interpretive programs, hunting, fishing, trapping, and wildlife observation.
  The equipment and facilities section of the report provides information about rehabilitation,
  equipment replacement, communication systems, computer systems, and energy conservation.
  Cooperative programs and items of interest are provided at the end.\",\n\t\"owner_org\":
